import React, {Component} from 'react';
import {connect} from 'react-redux';
import {fetchFoods} from '../../store/actions/foods'

class PlanAlimenticio extends Component{

  componentDidMount(){
    const { currentUserId } = this.props;
    this.props.fetchFoods(currentUserId, console.log(this.props));
  }

  render(){
    const {foods}=this.props
    return(
      <div>
        <ul>
          {foods.map(function(food){
            return <li>{food.foodName}</li>;
            return <li>{food.protein_g}</li>;
            return <li>{food.carbs_g}</li>;
          })}
        </ul>
      </div>
      )
  }
}

function mapStateToProps(state){
  return{
    foods: state.foods,
    currentUserId: state.currentUser.user.id
  };
};

export default connect(mapStateToProps, {fetchFoods})(PlanAlimenticio);
